ADOBE DREAMWEAVER CS5 TRAINING DVD FOR WINDOWS &amp; MAC 

(exercise files included)      

Learn how to plan and set up a website, then dive into creating your first site 
and learn about CSS and how best to use it in your site. You'll also explore 
accessibility in tables, writing code, adding media and working with templates. 
Once you've learned all the ground work and set up your site, Dee will walk you 
through how to test and upload your site. By the time your are finished with this 
training, you will have all the skills you need to create and upload your first
website.

